import React from 'react';
import { Container, Row, Col, Card} from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Expedients = (props) => {
  return (
    <Container>
    	<Row>
    		<Col md={3}>
    			<Link to="/detail/123" className="shadow p-3 mb-5 bg-white rounded">
    				Regular shadow
    			</Link>
    		</Col>
    	</Row>
    </Container>
  )
}

export default Expedients;
